    const [loading, setLoading] = useState(false)

    const {currentUser} = useAuth()
    const navigate= useNavigate()

    const[posts, setPosts] = useState([
        {id:1, title: 'Porsche 911 GB', user:'Sharusan', profilePicture:'http://localhost:3001/uploads/3f736944d3729d94506db63f9b3f6335', image:`http://localhost:3001/uploads/b9453f083d3aaf3f3826875e2742faad`, description: 'Check My Car Fastest Car In The World', date:'26/01/24', time:'18:00', vrn:'EA64 SYJ', tspeed:'200', bhp:'500', torque:'100'},
        {id:2, title: 'Post 2', user:'Mate', image:'/uploads', description: 'Description 2'},
        {id:2, title: 'Post 2', user:'Mate', image:'/uploads', description: 'Description 2'},
        {id:2, title: 'Post 2', user:'Mate', image:'/uploads', description: 'Description 2'},
        {id:2, title: 'Post 2', user:'Mate', image:'/uploads', description: 'Description 2'},
    ])

